import React from 'react'

export default function Playlistcard({item}) {
    return (
        <div>
            <Link to={String(item.id)}> 
            <ReactPlayer  light url={item.url} className="player-listing" />
            <h2>{item.title}</h2>
            <h2>{item.channel}</h2>
            </Link>
            
        </div>
    )
}
